DROP TABLE IF EXISTS credit_scores CASCADE;
CREATE TABLE credit_scores (
    credit_score_id VARCHAR(50) PRIMARY KEY,
    customer_id VARCHAR(50),
    credit_score INTEGER,
    credit_bureau VARCHAR(255),
    num_tradelines INTEGER,
    total_debt DECIMAL(15,2),
    available_credit DECIMAL(15,2),
    utilization_rate DECIMAL(15,2),
    num_inquiries_6mo INTEGER,
    num_delinquencies INTEGER,
    bankruptcy_flag BOOLEAN,
    score_date DATE
);



















































